// frontend/src/App.js
import React from 'react';
import DataGenForm from './components/DataGenForm';
import axios from 'axios';

function App() {
  const handleSubmit = async (param) => {
    try {
      const response = await axios.post('http://localhost:3001/generate', { param });
      console.log('Generated Data:', response.data);
    } catch (error) {
      console.error('Error generating data:', error);
    }
  };

  return (
    <div style={{ padding: '20px', backgroundColor: 'black', minHeight: '100vh' }}>
      <DataGenForm onSubmit={handleSubmit} />
    </div>
  );
}

export default App;
